    Result += GetCurrBoneSkinningMatrix_Emitter_Mesh(SectionBoneOffset + BlendIndices.z) * BlendWeights.z;
    Result += GetCurrBoneSkinningMatrix_Emitter_Mesh(SectionBoneOffset + BlendIndices.w) * BlendWeights.w;
	return Result;
}

void IsValidTriCoord_Emitter_Mesh(in int TriangleIndex, out bool IsValid)
{
	IsValid = TriangleIndex >= 0 && TriangleIndex < Emitter_Mesh_MeshTriangleCount;
}

void GetVertex_Emitter_Mesh(uint VertexIndex, out float3 OutPosition, out float3 OutTangentX, out float3 OutTangentY, out float3 OutTangentZ)
{
	// Early out for bad data
	if ( Emitter_Mesh_MeshVertexCount == 0 )
	{
		OutPosition = float3(0.0f, 0.0f, 0.0f);
		OutTangentX = float3(1.0f, 0.0f, 0.0f);
		OutTangentY = float3(0.0f, 1.0f, 0.0f);
		OutTangentZ = float3(0.0f, 0.0f, 1.0f);
		return;
	}

	VertexIndex = clamp(VertexIndex, 0, Emitter_Mesh_MeshVertexCount - 1);

	//-TODO: Use a R32G32B32 format
	float3 Position = float3(Emitter_Mesh_MeshVertexBuffer[VertexIndex * 3], Emitter_Mesh_MeshVertexBuffer[VertexIndex * 3 + 1], Emitter_Mesh_MeshVertexBuffer[VertexIndex * 3 + 2]);
	float3 TangentX = TangentBias(Emitter_Mesh_MeshTangentBuffer[VertexIndex * 2    ].xyz);
	float4 TangentZ = TangentBias(Emitter_Mesh_MeshTangentBuffer[VertexIndex * 2 + 1].xyzw);	
	float3 TangentY = cross(TangentZ.xyz, TangentX.xyz) * TangentZ.w;

	OutPosition = Position;
	OutTangentX = cross(TangentY, TangentZ.xyz) * TangentZ.w;
	OutTangentY = TangentY;
	OutTangentZ = TangentZ.xyz;
}

void GetVertexData_Emitter_Mesh(int VertexIndex, out float3 OutPosition, out float3 OutTangentX, out float3 OutTangentY, out float3 OutTangentZ)
{
	GetVertex_Emitter_Mesh(VertexIndex, OutPosition, OutTangentX, OutTangentY, OutTangentZ);
}

void GetPointOnTriangle_Emitter_Mesh(uint TriangleIndex, float3 BaryCoord, out float3 OutPosition, out float3 OutTangentX, out float3 OutTangentY, out float3 OutTangentZ)
{
	// Early out for bad data
	if ( Emitter_Mesh_MeshTriangleCount == 0 )
	{
		OutPosition = float3(0.0f, 0.0f, 0.0f);
		OutTangentX = float3(1.0f, 0.0f, 0.0f);
		OutTangentY = float3(0.0f, 1.0f, 0.0f);
		OutTangentZ = float3(0.0f, 0.0f, 1.0f);
		return;
	}

	TriangleIndex = clamp(TriangleIndex, 0, Emitter_Mesh_MeshTriangleCount - 1);

	uint IndexBufferOffset = TriangleIndex * 3;
	uint VertexIndex0 = Emitter_Mesh_MeshIndexBuffer[IndexBufferOffset];
	uint VertexIndex1 = Emitter_Mesh_MeshIndexBuffer[IndexBufferOffset + 1];
	uint VertexIndex2 = Emitter_Mesh_MeshIndexBuffer[IndexBufferOffset + 2];

	float3 Positions[3], TangentsX[3], TangentsY[3], TangentsZ[3];
	GetVertex_Emitter_Mesh(VertexIndex0, Positions[0], TangentsX[0], TangentsY[0], TangentsZ[0]);
	GetVertex_Emitter_Mesh(VertexIndex1, Positions[1], TangentsX[1], TangentsY[1], TangentsZ[1]);
	GetVertex_Emitter_Mesh(VertexIndex2, Positions[2], TangentsX[2], TangentsY[2], TangentsZ[2]);
	OutPosition = Positions[0] * BaryCoord.x + Positions[1] * BaryCoord.y  + Positions[2] * BaryCoord.z;
	OutTangentX = TangentsX[0] * BaryCoord.x + TangentsX[1] * BaryCoord.y  + TangentsX[2] * BaryCoord.z;
	OutTangentY = TangentsY[0] * BaryCoord.x + TangentsY[1] * BaryCoord.y  + TangentsY[2] * BaryCoord.z;
	OutTangentZ = TangentsZ[0] * BaryCoord.x + TangentsZ[1] * BaryCoord.y  + TangentsZ[2] * BaryCoord.z;
}

FDISkelMeshSkinnedVertex GetSkinnedVertex_Emitter_Mesh(uint VertexIndex)
{
	// Early out for bad data
	if ( Emitter_Mesh_MeshVertexCount == 0 )
	{
		FDISkelMeshSkinnedVertex SkinnedVertex;
		SkinnedVertex.Position = float3(0.0f, 0.0f, 0.0f);
		SkinnedVertex.PrevPosition = float3(0.0f, 0.0f, 0.0f);
		SkinnedVertex.TangentX = float3(1.0f, 0.0f, 0.0f);
		SkinnedVertex.TangentY = float3(0.0f, 1.0f, 0.0f);
		SkinnedVertex.TangentZ = float3(0.0f, 0.0f, 1.0f);
		return SkinnedVertex;
	}

	VertexIndex = clamp(VertexIndex, 0, Emitter_Mesh_MeshVertexCount - 1);

	//-TODO: Use a R32G32B32 format
	float3 CurrPosition = float3(Emitter_Mesh_MeshVertexBuffer[VertexIndex * 3], Emitter_Mesh_MeshVertexBuffer[VertexIndex * 3 + 1], Emitter_Mesh_MeshVertexBuffer[VertexIndex * 3 + 2]);
	float3 PrevPosition = CurrPosition;

	float3 TangentX = TangentBias(Emitter_Mesh_MeshTangentBuffer[VertexIndex * 2    ].xyz);
	float4 TangentZ = TangentBias(Emitter_Mesh_MeshTangentBuffer[VertexIndex * 2 + 1].xyzw);
	
	if ( Emitter_Mesh_MeshNumWeights > 0 )
	{
		float3x4 PrevBoneMatrix;
		float3x4 CurrBoneMatrix;

		// Get the matrix offset for each vertex because BlendIndices are stored relatively to each section start vertex.
		uint SectionBoneOffset = Emitter_Mesh_MeshTriangleMatricesOffsetBuffer[VertexIndex];

#if DISKELMESH_BONE_INFLUENCES == DISKELMESH_BONE_INFLUENCES_UNLIMITED
		BRANCH
		if (UnlimitedBoneInfluences_Emitter_Mesh())
		{
			uint BlendOffsetCount = Emitter_Mesh_MeshSkinWeightLookupBuffer[VertexIndex];
			int NumBoneInfluences = BlendOffsetCount & 0xff;
			int StreamOffset = BlendOffsetCount >> 8;
			int WeightsOffset = StreamOffset + (Emitter_Mesh_MeshSkinWeightIndexSize * NumBoneInfluences);

			PrevBoneMatrix = float3x4(float4(0,0,0,0), float4(0,0,0,0), float4(0,0,0,0));
			CurrBoneMatrix = float3x4(float4(0,0,0,0), float4(0,0,0,0), float4(0,0,0,0));
			for (int InfluenceIdx = 0; InfluenceIdx < NumBoneInfluences; InfluenceIdx++)
			{
				int BoneIndexOffset = StreamOffset + (Emitter_Mesh_MeshSkinWeightIndexSize * InfluenceIdx);
				int BoneIndex = Emitter_Mesh_MeshSkinWeightBuffer[BoneIndexOffset];
				if (Emitter_Mesh_MeshSkinWeightIndexSize > 1)
				{
					BoneIndex = Emitter_Mesh_MeshSkinWeightBuffer[BoneIndexOffset + 1] << 8 | BoneIndex;
					//@todo-lh: Workaround to fix issue in SPIRVEmitter of DXC; this block must be inside the if branch
					float BoneWeight = float(Emitter_Mesh_MeshSkinWeightBuffer[WeightsOffset + InfluenceIdx]) / 255.0f;

					PrevBoneMatrix += GetPrevBoneSkinningMatrix_Emitter_Mesh(SectionBoneOffset + BoneIndex) * BoneWeight;
					CurrBoneMatrix += GetCurrBoneSkinningMatrix_Emitter_Mesh(SectionBoneOffset + BoneIndex) * BoneWeight;
				}
				else
				{
					//@todo-lh: Workaround to fix issue in SPIRVEmitter of DXC; this block must be inside the if branch
					float BoneWeight = float(Emitter_Mesh_MeshSkinWeightBuffer[WeightsOffset + InfluenceIdx]) / 255.0f;

					PrevBoneMatrix += GetPrevBoneSkinningMatrix_Emitter_Mesh(SectionBoneOffset + BoneIndex) * BoneWeight;
					CurrBoneMatrix += GetCurrBoneSkinningMatrix_Emitter_Mesh(SectionBoneOffset + BoneIndex) * BoneWeight;
				}
			}	
		}
		else
#endif
		{
			uint WeightOffset = Emitter_Mesh_MeshNumWeights == 8 ? 2 : 1;
			int4 BlendIndices = DISkelMesh_UnpackIndices4(Emitter_Mesh_MeshSkinWeightBuffer[VertexIndex * Emitter_Mesh_MeshWeightStride]);
	        float4 BlendWeights = DISkelMesh_UnpackWeights4(Emitter_Mesh_MeshSkinWeightBuffer[VertexIndex * Emitter_Mesh_MeshWeightStride + WeightOffset]);
			CurrBoneMatrix = GetCurrSkinningMatrix_Emitter_Mesh(SectionBoneOffset, BlendIndices, BlendWeights);
			PrevBoneMatrix = GetPrevSkinningMatrix_Emitter_Mesh(SectionBoneOffset, BlendIndices, BlendWeights);
#if DISKELMESH_BONE_INFLUENCES != DISKELMESH_BONE_INFLUENCES_MAX4
			// We are in 8 or unlimited mode so need to check for the extended weights
			if (Emitter_Mesh_MeshNumWeights == 8)
			{
			    BlendIndices = DISkelMesh_UnpackIndices4(Emitter_Mesh_MeshSkinWeightBuffer[VertexIndex * Emitter_Mesh_MeshWeightStride + 1]);
			    BlendWeights = DISkelMesh_UnpackWeights4(Emitter_Mesh_MeshSkinWeightBuffer[VertexIndex * Emitter_Mesh_MeshWeightStride + WeightOffset + 1]);
				CurrBoneMatrix += GetCurrSkinningMatrix_Emitter_Mesh(SectionBoneOffset, BlendIndices, BlendWeights);
				PrevBoneMatrix += GetPrevSkinningMatrix_Emitter_Mesh(SectionBoneOffset, BlendIndices, BlendWeights);
			}
#endif
		}

		CurrPosition = mul(CurrBoneMatrix, float4(CurrPosition, 1.0f)).xyz;
		PrevPosition = mul(PrevBoneMatrix, float4(PrevPosition, 1.0f)).xyz;

		// Not using InverseTranspose of matrices so assuming uniform scaling only (same as SkinCache)
		TangentX.xyz = mul(CurrBoneMatrix, float4(TangentX.xyz, 0.0f)).xyz;
		TangentZ.xyz = mul(CurrBoneMatrix, float4(TangentZ.xyz, 0.0f)).xyz;
	}

	float3 TangentY = cross(TangentZ.xyz, TangentX.xyz) * TangentZ.w;

	FDISkelMeshSkinnedVertex SkinnedVertex;
	SkinnedVertex.Position = CurrPosition;
	SkinnedVertex.PrevPosition = PrevPosition;
	SkinnedVertex.TangentX = cross(TangentY, TangentZ.xyz) * TangentZ.w;
	SkinnedVertex.TangentY = TangentY;
	SkinnedVertex.TangentZ = TangentZ.xyz;
	return SkinnedVertex;
}

FDISkelMeshSkinnedVertex GetSkinnedPointOnTriangle_Emitter_Mesh(uint TriangleIndex, float3 BaryCoord)
{
	// Early out for bad data
	if ( Emitter_Mesh_MeshTriangleCount == 0 )
	{
		FDISkelMeshSkinnedVertex SkinnedVertex;
		SkinnedVertex.Position = float3(0.0f, 0.0f, 0.0f);
		SkinnedVertex.PrevPosition = float3(0.0f, 0.0f, 0.0f);
		SkinnedVertex.TangentX = float3(1.0f, 0.0f, 0.0f);
		SkinnedVertex.TangentY = float3(0.0f, 1.0f, 0.0f);
		SkinnedVertex.TangentZ = float3(0.0f, 0.0f, 1.0f);
		return SkinnedVertex;
	}

	TriangleIndex = clamp(TriangleIndex, 0, Emitter_Mesh_MeshTriangleCount - 1);

	uint IndexBufferOffset = TriangleIndex * 3;
	uint VertexIndex0 = Emitter_Mesh_MeshIndexBuffer[IndexBufferOffset];
	uint VertexIndex1 = Emitter_Mesh_MeshIndexBuffer[IndexBufferOffset + 1];
	uint VertexIndex2 = Emitter_Mesh_MeshIndexBuffer[IndexBufferOffset + 2];

	FDISkelMeshSkinnedVertex SkinnedVertex0 = GetSkinnedVertex_Emitter_Mesh(VertexIndex0);
	FDISkelMeshSkinnedVertex SkinnedVertex1 = GetSkinnedVertex_Emitter_Mesh(VertexIndex1);
	FDISkelMeshSkinnedVertex SkinnedVertex2 = GetSkinnedVertex_Emitter_Mesh(VertexIndex2);

	FDISkelMeshSkinnedVertex FinalVertex;
	FinalVertex.Position		= (SkinnedVertex0.Position * BaryCoord.x) + (SkinnedVertex1.Position * BaryCoord.y) + (SkinnedVertex2.Position * BaryCoord.z);
	FinalVertex.PrevPosition	= (SkinnedVertex0.PrevPosition * BaryCoord.x) + (SkinnedVertex1.PrevPosition * BaryCoord.y) + (SkinnedVertex2.PrevPosition * BaryCoord.z);
	FinalVertex.TangentX		= (SkinnedVertex0.TangentX * BaryCoord.x) + (SkinnedVertex1.TangentX * BaryCoord.y) + (SkinnedVertex2.TangentX * BaryCoord.z);
	FinalVertex.TangentY		= (SkinnedVertex0.TangentY * BaryCoord.x) + (SkinnedVertex1.TangentY * BaryCoord.y) + (SkinnedVertex2.TangentY * BaryCoord.z);
	FinalVertex.TangentZ		= (SkinnedVertex0.TangentZ * BaryCoord.x) + (SkinnedVertex1.TangentZ * BaryCoord.y) + (SkinnedVertex2.TangentZ * BaryCoord.z);

	return FinalVertex;
}

FDISkelMeshSkinnedVertex GetSkinnedPointOnTriangleWS_Emitter_Mesh(uint TriangleIndex, float3 BaryCoord)
{
	FDISkelMeshSkinnedVertex FinalVertex = GetSkinnedPointOnTriangle_Emitter_Mesh(TriangleIndex, BaryCoord);
	FinalVertex.Position		= mul(float4(FinalVertex.Position, 1.0f), Emitter_Mesh_InstanceTransform).xyz;
	FinalVertex.PrevPosition	= mul(float4(FinalVertex.PrevPosition, 1.0f), Emitter_Mesh_InstancePrevTransform).xyz;
	FinalVertex.TangentX		= mul(float4(FinalVertex.TangentX, 0.0f), Emitter_Mesh_InstanceTransform).xyz;
	FinalVertex.TangentY		= mul(float4(FinalVertex.TangentY, 0.0f), Emitter_Mesh_InstanceTransform).xyz;
	FinalVertex.TangentZ		= mul(float4(FinalVertex.TangentZ, 0.0f), Emitter_Mesh_InstanceTransform).xyz;

	return FinalVertex;
}

void RandomTriCoord_Emitter_Mesh(uint Seed1, uint Seed2, uint Seed3, out int OutTriangle, out float3 OutBaryCoord)
{
	// Early out for bad data
	if (Emitter_Mesh_MeshTriangleCount == 0)
	{
		OutTriangle = -1;
		OutBaryCoord = 1.0f / 3.0f;
		return;
	}

	float RandT0 = DISKelMesh_Random(Seed1, Seed2, Seed3);

	[branch]
	if ( !UniformTriangleSamplingEnable_Emitter_Mesh() )
	{
		// Uniform triangle id selection
		OutTriangle = min(uint(RandT0 * float(Emitter_Mesh_MeshTriangleCount)), Emitter_Mesh_MeshTriangleCount - 1); // avoid % by using mul/min to Tri = MeshTriangleCountName
	}
	else
	{
		// Uniform area weighted position selection (using alias method from Alias method from FWeightedRandomSampler)
		uint TriangleIndex = min(uint(RandT0*float(Emitter_Mesh_MeshTriangleCount)), Emitter_Mesh_MeshTriangleCount - 1);

#if DISKELMESH_PROBALIAS_FORMAT == DISKELMESH_PROBALIAS_FORMAT_64
		float TriangleProbability = asfloat(Emitter_Mesh_MeshTriangleSamplerProbAliasBuffer[(TriangleIndex * 2) + 0]);
		uint TriangleAlias = Emitter_Mesh_MeshTriangleSamplerProbAliasBuffer[(TriangleIndex * 2) + 1];
#elif DISKELMESH_PROBALIAS_FORMAT == DISKELMESH_PROBALIAS_FORMAT_24_8
		uint TriangleProbAlias = Emitter_Mesh_MeshTriangleSamplerProbAliasBuffer[TriangleIndex];
		float TriangleProbability = float(TriangleProbAlias & 0xff) / 255.0f;
		uint TriangleAlias = TriangleProbAlias >> 8;
#elif DISKELMESH_PROBALIAS_FORMAT == DISKELMESH_PROBALIAS_FORMAT_23_9
		uint TriangleProbAlias = Emitter_Mesh_MeshTriangleSamplerProbAliasBuffer[TriangleIndex];
		float TriangleProbability = float(TriangleProbAlias & 0x1ff) / 511.0f;
		uint TriangleAlias = TriangleProbAlias >> 9;
#endif

		// Alias check
		float RandT1 = DISKelMesh_Random(Seed1, Seed2, Seed3);
		if( RandT1 > TriangleProbability )
		{
			TriangleIndex = TriangleAlias;
		}
		OutTriangle = int(TriangleIndex);
	}

	OutBaryCoord = DISKelMesh_RandomBarycentricCoord(Seed1, Seed2, Seed3);
}

void GetSkinnedTriangleDataWS_Emitter_Mesh(in uint TriangleIndex, in float3 BaryCoord, out float3 OutPosition, out float3 OutVelocity, out float3 OutNormal, out float3 OutBinormal, out float3 OutTangent)
{
    FDISkelMeshSkinnedVertex SkinnedVertex = GetSkinnedPointOnTriangleWS_Emitter_Mesh(TriangleIndex, BaryCoord);
	OutPosition	= SkinnedVertex.Position;
	OutVelocity	= (SkinnedVertex.Position - SkinnedVertex.PrevPosition) * Emitter_Mesh_InstanceInvDeltaTime;
	OutNormal	= normalize(SkinnedVertex.TangentZ);
	OutBinormal	= normalize(SkinnedVertex.TangentY);
	OutTangent	= normalize(SkinnedVertex.TangentX);
}

