void GetTriangleCoordAtUV_Emitter_Mesh(bool Enabled, float2 InUv, float InTolerance, out int OutTriangle, out float3 OutBaryCoord, out bool OutIsValid)
{
	UvMappingParameters MappingParam;
	MappingParam.NumUVs = Emitter_Mesh_MeshNumTexCoord;
	MappingParam.IndexBuffer = Emitter_Mesh_MeshIndexBuffer;
	MappingParam.UVBuffer = Emitter_Mesh_MeshTexCoordBuffer;
	MappingParam.UvMappingBuffer = Emitter_Mesh_UvMappingBuffer;
