void GetTriVertices_Emitter_Mesh(in uint TriangleIndex, out int VertexIndex0, out int VertexIndex1, out int VertexIndex2)
{
	// Early out for bad data
	if ( Emitter_Mesh_MeshTriangleCount == 0 )
	{
		VertexIndex0 = 0;
		VertexIndex1 = 0;
		VertexIndex2 = 0;
		return;
	}

	TriangleIndex = clamp(TriangleIndex, 0, Emitter_Mesh_MeshTriangleCount - 1);
    uint IndexBufferOffset = TriangleIndex * 3;
    VertexIndex0 = Emitter_Mesh_MeshIndexBuffer[IndexBufferOffset];
    VertexIndex1 = Emitter_Mesh_MeshIndexBuffer[IndexBufferOffset + 1];
    VertexIndex2 = Emitter_Mesh_MeshIndexBuffer[IndexBufferOffset + 2];
}

