}

void GetTriColor_Emitter_Mesh(in uint TriangleIndex, in float3 BaryCoord, out float4 OutColor)
{
	// Early out for bad data
	if ( HasMeshColors_Emitter_Mesh() == false )
	{
		OutColor = float4(1, 1, 1, 1);
		return;
	}
	TriangleIndex = clamp(TriangleIndex, 0, Emitter_Mesh_MeshTriangleCount - 1);

    uint IndexBufferOffset = TriangleIndex * 3;
    uint VertexIndex0 = Emitter_Mesh_MeshIndexBuffer[IndexBufferOffset];
    uint VertexIndex1 = Emitter_Mesh_MeshIndexBuffer[IndexBufferOffset + 1];
    uint VertexIndex2 = Emitter_Mesh_MeshIndexBuffer[IndexBufferOffset + 2];
    OutColor = (Emitter_Mesh_MeshColorBuffer[VertexIndex0] FMANUALFETCH_COLOR_COMPONENT_SWIZZLE * BaryCoord.x) + (Emitter_Mesh_MeshColorBuffer[VertexIndex1] FMANUALFETCH_COLOR_COMPONENT_SWIZZLE * BaryCoord.y) + (Emitter_Mesh_MeshColorBuffer[VertexIndex2] FMANUALFETCH_COLOR_COMPONENT_SWIZZLE * BaryCoord.z);
}

void GetSkinnedVertexData_Emitter_Mesh(in int VertexIndex, out float3 OutPosition, out float3 OutVelocity, out float3 OutNormal, out float3 OutBinormal, out float3 OutTangent)
{
    FDISkelMeshSkinnedVertex SkinnedVertex = GetSkinnedVertex_Emitter_Mesh(VertexIndex);
    OutPosition = SkinnedVertex.Position;
    OutVelocity = (SkinnedVertex.Position - SkinnedVertex.PrevPosition) * Emitter_Mesh_InstanceInvDeltaTime;
	OutNormal = SkinnedVertex.TangentZ;
	OutBinormal = SkinnedVertex.TangentY;
	OutTangent = SkinnedVertex.TangentX;
}

void GetSkinnedVertexDataWS_Emitter_Mesh(in int VertexIndex, out float3 OutPosition, out float3 OutVelocity, out float3 OutNormal, out float3 OutBinormal, out float3 OutTangent)
{
    FDISkelMeshSkinnedVertex SkinnedVertex = GetSkinnedVertex_Emitter_Mesh(VertexIndex);
    OutPosition = mul(float4(SkinnedVertex.Position, 1.0f), Emitter_Mesh_InstanceTransform).xyz;
    float3 PrevPosition = mul(float4(SkinnedVertex.PrevPosition, 1.0f), Emitter_Mesh_InstancePrevTransform).xyz;
    OutVelocity = (SkinnedVertex.Position - SkinnedVertex.PrevPosition) * Emitter_Mesh_InstanceInvDeltaTime;
    OutNormal   = normalize(mul(float4(SkinnedVertex.TangentZ, 0.0f), Emitter_Mesh_InstanceTransform).xyz);
    OutBinormal = normalize(mul(float4(SkinnedVertex.TangentY, 0.0f), Emitter_Mesh_InstanceTransform).xyz);
    OutTangent  = normalize(mul(float4(SkinnedVertex.TangentX, 0.0f), Emitter_Mesh_InstanceTransform).xyz);
}

