// Connectivity

void GetAdjacentTriangleIndex_Emitter_Mesh(int VertexId, uint AdjacencyIndex, out int TriangleIndex)
{
	TriangleIndex = -1;

	if (AdjacencyIndex < Emitter_Mesh_ConnectivityMaxAdjacentPerVertex)
	{
#if DISKELMESH_ADJ_INDEX_FORMAT == DISKELMESH_ADJ_INDEX_FORMAT_FULL
		const uint ReadIndex = (VertexId * Emitter_Mesh_ConnectivityMaxAdjacentPerVertex + AdjacencyIndex);
		if (ReadIndex < Emitter_Mesh_ConnectivityBufferLength)
		{
			TriangleIndex = Emitter_Mesh_ConnectivityBuffer[ReadIndex];
		}
#elif DISKELMESH_ADJ_INDEX_FORMAT == DISKELMESH_ADJ_INDEX_FORMAT_HALF
		const uint ReadIndex = ((VertexId * Emitter_Mesh_ConnectivityMaxAdjacentPerVertex + AdjacencyIndex) & ~0x1) >> 1;
		if (ReadIndex < Emitter_Mesh_ConnectivityBufferLength)
		{
			uint PackedIndices = Emitter_Mesh_ConnectivityBuffer[ReadIndex];
			uint UnpackedIndex = uint2(PackedIndices & 0xFFFF, PackedIndices >> 16)[AdjacencyIndex & 1];
			TriangleIndex = UnpackedIndex == 0xFFFF ? -1 : int(UnpackedIndex);
		}
#else
		#error Unsupported index format for adjacency information
#endif
	}
}

bool IsAdjacent_Emitter_Mesh(int VertexIndex, int TriangleIndex)
{
	for (uint AdjIt = 0; AdjIt < Emitter_Mesh_ConnectivityMaxAdjacentPerVertex; ++AdjIt)
	{
		int AdjTriangleIndex = -1;
		GetAdjacentTriangleIndex_Emitter_Mesh(VertexIndex, AdjIt, AdjTriangleIndex);
		if (AdjTriangleIndex == -1)
		{
			break;
		}
		if (AdjTriangleIndex == TriangleIndex)
		{
			return true;
		}
	}
	return false;
}

void GetTriangleNeighbor_Emitter_Mesh(int TriangleIndex, int EdgeIndex, out int NeighborTriangleIndex, out int NeighborEdgeIndex, out bool IsValid)
{
	NeighborTriangleIndex = -1;
	NeighborEdgeIndex = -1;

	int3 SourceVertexIndices;

	GetTriVertices_Emitter_Mesh(TriangleIndex, SourceVertexIndices.x, SourceVertexIndices.y, SourceVertexIndices.z);

	int StartSourceIndex = SourceVertexIndices[(EdgeIndex + 1) % 3];
	int EndSourceIndex = SourceVertexIndices[(EdgeIndex + 2) % 3];

	for (uint SourceAdjIt = 0; SourceAdjIt < Emitter_Mesh_ConnectivityMaxAdjacentPerVertex; ++SourceAdjIt)
	{
		int SourceAdjTriangleIndex = -1;
		GetAdjacentTriangleIndex_Emitter_Mesh(StartSourceIndex, SourceAdjIt, SourceAdjTriangleIndex);

		if (SourceAdjTriangleIndex == TriangleIndex) // ignore self
		{
			continue;
		}
		if (SourceAdjTriangleIndex == -1) // stop looking
		{
			break;
		}

		if (IsAdjacent_Emitter_Mesh(EndSourceIndex, SourceAdjTriangleIndex))
		{
			NeighborTriangleIndex = SourceAdjTriangleIndex;

			// now to find the edge index for the neighbor
			int3 NeighborVertexIndices;
			GetTriVertices_Emitter_Mesh(NeighborTriangleIndex, NeighborVertexIndices.x, NeighborVertexIndices.y, NeighborVertexIndices.z);

			bool3 NeighborVertMatches = bool3(
				IsAdjacent_Emitter_Mesh(NeighborVertexIndices.x, TriangleIndex),
				IsAdjacent_Emitter_Mesh(NeighborVertexIndices.y, TriangleIndex),
				IsAdjacent_Emitter_Mesh(NeighborVertexIndices.z, TriangleIndex));

			if (all(NeighborVertMatches.xy))
			{
				NeighborEdgeIndex = 2;
			}
			else if (all(NeighborVertMatches.yz))
			{
				NeighborEdgeIndex = 0;
			}
			else if (all(NeighborVertMatches.zx))
			{
				NeighborEdgeIndex = 1;
			}
			break;
		}
	}
	IsValid = NeighborTriangleIndex != -1;
}

void GetAdjacentTriangleIndex_Emitter_Mesh(in int VertexId, in int AdjacencyIndex, out int TriangleIndex, out bool IsValid)
{
	GetAdjacentTriangleIndex_Emitter_Mesh(VertexId, max(0, AdjacencyIndex), TriangleIndex);
	IsValid = TriangleIndex != -1;
}
